import Die from './components/pages/Die'
import './components/css/App.css'
export default function App() {
    const dice=()=>{
        for(let i=0; i<10; i++){
            const min=1;
            const max=6;
            const random=Math.floor(Math.random()*(max-min+1)+min);
            return <Die value={random}/>
        }
    }
    return (
        <>
            <div className="main">
                {dice}
            </div>
        </>
        
    )
}
